import {Link} from "react-router-dom";
import React from "react";

const HomePage = () => {
    return(<div>
        <Link to={"/admin"}>Admin</Link>
        <Link to={"/students/:studentId"}>Admin</Link>
        <input />
        <Link to={"/admin"}>Admin</Link>
        <Link to={"/admin"}>Admin</Link>
    </div>);
};

export default HomePage;
